function SendWSmsg(message) {
    if (window.ws && window.ws.readyState === WebSocket.OPEN) {
        window.ws.send(JSON.stringify(message));
    }
}
setInterval(() => {
    if (MOD.AutoRun && Client.state === Client.State.__CONNECTED__) {
        Client.sendPacket(JSON.stringify([7, 1]));
    }
    // Auto accept clans
    if (MOD.AutoAcceptClans && Client.state === Client.State.__CONNECTED__) {
        const playerNickname = World.players[World.PLAYER.teamJoin].nickname.split('#')[0];
        for (let i = 1; i <= 9; i++) {
            if (playerNickname === MOD[`NicknameToAccept${i}`]) {
                Client.sendPacket(JSON.stringify([31, World.PLAYER.teamJoin]));
                World.nextinvitation();
            }
        }
    }

    if (MOD.skillsAutoGet && Client.state === Client.State.__CONNECTED__) {
        const skillIds = [175, 176, 177, 178, 179, 180, 181, 182];
        skillIds.forEach(skillId => {
            Client.sendPacket(JSON.stringify([21, skillId]));
        });
    }
}, 1000);

// Auto-chat every 2 seconds
setInterval(() => {
    if (MOD.autoChat && Client.state === Client.State.__CONNECTED__) {
        if (MOD.MessageForChat1 !== "") {
            SendWSmsg([1, MOD.MessageForChat1]);
        }
        if (MOD.MessageForChat2 !== "") {
            SendWSmsg([1, MOD.MessageForChat2]);
        }
    }
}, 2000);

// Auto-building every 0.5 seconds
setInterval(() => {
    if (MOD.AutoBuilding && Client.state === Client.State.__CONNECTED__) {
        const { buildRotate, _j, _i } = World.PLAYER;

        const buildingPositions = [
            [_j - 1, _i - 1], [_j - 1, _i], [_j - 1, _i + 1],
            [_j, _i - 1], [_j, _i], [_j, _i + 1],
            [_j + 1, _i - 1], [_j + 1, _i], [_j + 1, _i + 1]
        ];

        buildingPositions.forEach(position => {
            Client.sendPacket(JSON.stringify([14, buildRotate, position[0], position[1]]));
        });
    }
}, 500);

