    function extractValuesFromText(pastedText) {
        var values = pastedText.match(/"([^"]*)"/g);

        if (values && values.length === 3) {
            return {
                token: values[0].slice(1, -1),
                tokenId: values[1].slice(1, -1),
                userId: values[2].slice(1, -1),
            };
        } else {
            return null;
        }
    }

